//Использование фильтра
var result = "";
var esq = new EntitySchemaQuery(UserConnection.EntitySchemaManager, nameof(Account));
esq.AddColumn("Id");
var colName = esq.AddColumn("Name");
esq.Filters.Add(esq.CreateFilterWithParameters(FilterComparisonType.Equal, "Id", new string[] { "405947D0-2FFB-4DED-8675-0475F19F5A81", "2859B370-E848-4470-9A23-2D37BD18D9ED" }));
var entities = esq.GetEntityCollection(UserConnection);
for (int i=0; i < entities.Count; i++) {
     result += entities[i].GetColumnValue(colName.Name).ToString();
     result += "\n";
}
Set<string>("Result", result);

return true;
